function Pagination() {
  return (
    <>
             {exercises.map((exercise) => (
              <ExerciseCard
                key={exercise.id}
                id={exercise.id}
                type={exercise.type}
                part={exercise.part}
                name={exercise.name}
                duration={exercise.duration}
                calories={exercise.calories} 
                openCard={openCard} />
            ))}
            </>
  )
}

export default Pagination;
